import Navbar from './navbar';
import Home from './Home';
import { BrowserRouter as Router, Switch } from 'react-router-dom';
import { Route } from 'react-router-dom/cjs/react-router-dom.min';


function App() {
  const name = "Hamed"

  return (
    <Router>
      <div className="App">
        <Navbar></Navbar>
        <div className="content">
          <Switch>
            <Route path="/">
              <Home></Home>
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
